# -*- coding: utf-8 -*-
"""
爬取美团外卖的商家目录的爬虫部分
首先知道每一个目录页的地址需要的参数包括城市的地理位置信息(城市名，经纬度)
然后需要post ajax请求的地址是http://waimai.meituan.com/ajax/poilist?_token='+ token
我们伪造header和token
header主要是page_offset参数和cookie的改变，以及content-length会有随之变化
token没能破解掉，过期了之后只能手动进行更换
"""

import re
import csv
import urllib
import requests
from bs4 import BeautifulSoup
import time
import logging

def set_log():
    LOG_FMT = '%(asctime)s-%(levelname)s\t%(message)s'
    logging.basicConfig(format=LOG_FMT, level=logging.INFO, filename='meituanSpider.log', filemode='a')

def write_csv(city, datas):
    with open('%s_restaurant_list.csv' % (city), 'a', encoding='utf8') as f:
        writer = csv.writer(f, dialect='excel')
        writer.writerow(datas)

# 点击加载更多商家
# post我们的offset参数去获取一个response的data
# data是json格式的，但是在python下关键字有不同，需要转换
def get_more_restaurant_url(city, url, user_agent, content_length, page_offset, originUrl, cookie):
    logging.info('ip: 223.152.30.200')
    logging.info('url: ' + originUrl)
    headers = { 'Host':'waimai.meituan.com',
                'Connection':'keep-alive',
                'Content-Length':content_length,
                'Accept': 'application/json, text/javascript, */*; q=0.01',
                'Origin':'http://waimai.meituan.com',
                'X-Requested-With':'XMLHttpRequest',
                'User-Agent':user_agent,
                'Content-Type':'application/x-www-form-urlencoded; charset=UTF-8',
                'Referer':'http://waimai.meituan.com/home/wss14c9jpjsc',
                'Accept-Encoding':'gzip, deflate',
                'Accept-Language':'zh-CN,zh;q=0.9,en;q=0.8',
                'Cookie': cookie
                }
    response = requests.post(url, headers = headers, data ={'classify_type':'cate_all',
                                                            'sort_type':0,
                                                            'price_type':0,
                                                            'support_online_pay':0,
                                                            'support_invoice':0,
                                                            'support_logistic':0,
                                                            'page_offset':page_offset,
                                                            'page_size':20,
                                                            'uuid':'ovPRoOAlIrY8QnPPqyXGdO7nt2gKxsCTPYFR9U7wFLUrNzM7SYrxcNKE3wMQqgbO',
                                                            'platform':1,
                                                            'partner':4,
                                                            'originUrl':originUrl
                                                            })

    logging.info(response)
    # 把response转为json或者正则匹配
    # 因为没有找到合适的json包去转换小写的"true""false""null"关键字
    # 所以使用正则
    restaurant_url_and_name_match = re.findall(r'"wm_poi_id":.*?"name":".*?"', response.text)
    restaurant_monthly_sales_match = re.findall(r'"month_sale_num":.*?"', response.text)
    restaurant_phone_match = re.findall(r'"call_center":".*?"', response.text)
    restaurant_address_match = re.findall(r'"address":".*?"', response.text)
    # 每个response包含了20个商家
    for i in range(20):
        try:
            restaurant_name = restaurant_url_and_name_match[i][39:-1]
            restaurant_url = 'http://waimai.meituan.com/restaurant/' + str((restaurant_url_and_name_match)[i][12:30])
        except:
            restaurant_name = ""
            restaurant_url = ""
        try:
            restaurant_monthly_sales = '月售' + str(restaurant_monthly_sales_match[i][18:-3]) + '单'
        except:
            restaurant_monthly_sales = '月售0单'
        try:
            restaurant_phone = restaurant_phone_match[i][15:-1]
        except:
            restaurant_phone = ""
        try:
            restaurant_address = restaurant_address_match[i][11:-1]
        except:
            restaurant_address = ""
        datas = [restaurant_name, restaurant_url, restaurant_monthly_sales, restaurant_phone, restaurant_address]
        print (datas)
        write_csv(city, datas)

